import { useDispatch } from 'react-redux';
import { fillFully } from '../redux/recipes/actionCreators';

const dispatch = useDispatch();

const fetchData = () => {
	fetch('https://dummyjson.com/recipes')
		.then((res) => res.json())
		.then((res) => {
			dispatch(fillFully(res.recipes));
		});
};

export default fetchData;
